import styled from 'styled-components/native';
import { Ionicons } from '@expo/vector-icons';

export const Component = styled.View`
  display: flex;
  align-items: flex-start;
  position: relative;
  width: 100%;
  height: 18%;
  background-color: #33414b;
`;

export const HorseTab = styled.TouchableOpacity`
  flex-direction: row;
  color: white;
`;

export const HorseImage = styled.Image`
  width: 40px;
  height: 40px;
  margin-top: 10px;
  margin-left: 10px;
`;

export const HorsePoints = styled.Text`
  align-self: flex-start;
  color: #fff;
  top: 5%;
  left: 30%;
  font-weight: 500;
  font-size: 18px;
  letter-spacing: 1.5px;
`;

export const HorseName = styled.Text`
  justity-content: flex-start;
  top: 5%;
  left: 60%;
  color: #fff;
  font-weight: 500;
  font-size: 18px;
  letter-spacing: 1.5px;
`;

export const RightArrowIcon = styled(Ionicons)`
  position: absolute;
  font-size: 34px;
  margin-top: 10px;
  margin-left: 340px;
`;

export const Separator = styled.View`
  margin: 5px 20px 0 20px;
  height: 1px;
  width: 90%;
  background-color: rgba(255, 255, 255, 0.1);
`;

export const RiderTab = styled.TouchableOpacity`
  color: white;
`;

export const RiderImage = styled.Image`
  width: 40px;
  height: 40px;
  margin-top: 10px;
  margin-left: 10px;
`;

export const RiderName = styled.Text`
  position: absolute;
  width: 250px;
  color: white;
  font-weight: 500;
  margin-left: 120px;
  margin-top: 15px;
  font-size: 18px;
  letter-spacing: 1.5px;
`;

export const RiderNation = styled.Image`
  position: absolute;
  width: 32px;
  height: 20px;
  margin: 20px 0 0 70px;
`;
